import React, { useState, useEffect } from "react";
import { useNavigate } from "react-router-dom";
import RadarComparisonChart from "../components/radarChart/RadarComparisonRatio"; // Radar chart component
import "./explore.css";

function MultiSpaceExplore() {
  const navigate = useNavigate();

  const [allSubspaces, setAllSubspaces] = useState([]);
  const [selectedComparisons, setSelectedComparisons] = useState([]);
  const [subspace1, setSubspace1] = useState("");
  const [subspace2, setSubspace2] = useState("");
  const [metric, setMetric] = useState("avg");

  useEffect(() => {
    // Load subspaces from localStorage
    const savedSubspaces = JSON.parse(localStorage.getItem("subspaces")) || [];
    setAllSubspaces(savedSubspaces);
  }, []);

  const handleAddComparison = () => {
    if (!subspace1 || !subspace2 || subspace1 === subspace2) {
      alert("Please select two different subspaces to compare.");
      return;
    }
    // Add the comparison to the state
    setSelectedComparisons([
      ...selectedComparisons,
      { subspace1, subspace2, metric },
    ]);
    // Clear the dropdown selections
    setSubspace1("");
    setSubspace2("");
  };

  const handleMetricChange = (event) => setMetric(event.target.value);

  const getSubspaceDetails = (subspaceId) =>
    allSubspaces.find((s) => s.id === parseInt(subspaceId));

  const renderSubspaceNameWithTooltip = (subspaceId) => {
    const subspace = getSubspaceDetails(subspaceId);
    if (!subspace) return "Unknown Subspace";

    return (
      <span className="subspace-name">
        {subspace.name}
        <div className="tooltip-container">
          <button className="tooltip-button">?</button>
          <div className="tooltip-content">
            {subspace.attributes && subspace.attributes.length > 0 ? (
              `Attributes: ${subspace.attributes.join(", ")}`
            ) : (
              "No attributes selected for this subspace."
            )}
          </div>
        </div>
      </span>
    );
  };

  return (
    <div className="explore-page">
      {/* Header Section */}
      <div className="header">
        <h1>Multi-Subspace Exploration</h1>
        <div className="subspace-name">
          <div>
            <label>Subspace 1:</label>
            <select
              className="subspace-dropdown"
              value={subspace1}
              onChange={(e) => setSubspace1(e.target.value)}
            >
              <option value="">Select Subspace 1</option>
              {allSubspaces.map((s) => (
                <option key={s.id} value={s.id}>
                  {s.name}
                </option>
              ))}
            </select>
          </div>

          <div>
            <label>Subspace 2:</label>
            <select
              className="subspace-dropdown"
              value={subspace2}
              onChange={(e) => setSubspace2(e.target.value)}
            >
              <option value="">Select Subspace 2</option>
              {allSubspaces.map((s) => (
                <option key={s.id} value={s.id}>
                  {s.name}
                </option>
              ))}
            </select>
          </div>

          <div>
            <label>Metric:</label>
            <select
              className="subspace-dropdown"
              value={metric}
              onChange={handleMetricChange}
            >
              <option value="max">Max</option>
              <option value="avg">Average</option>
            </select>
          </div>

          <button
            style={{
              backgroundColor: "#136f63",
              color: "white",
              borderRadius: "6px",
              padding: "10px 20px",
              border: "none",
              cursor: "pointer",
              marginLeft: "10px",
              fontSize: "16px",
            }}
            onClick={handleAddComparison}
          >
            Add Comparison
          </button>
        </div>
      </div>

      {/* Plots Section */}
      <div className="plots-container">
        {selectedComparisons.map((comparison, index) => (
          <div key={index} className="plot-section">
            <h2>
              {renderSubspaceNameWithTooltip(comparison.subspace1)} -{" "}
              {renderSubspaceNameWithTooltip(comparison.subspace2)} (
              {comparison.metric.toUpperCase()})
            </h2>
            <RadarComparisonChart
              subInd1={comparison.subspace1}
              subInd2={comparison.subspace2}
              metric={comparison.metric}
            />
          </div>
        ))}
      </div>
    </div>
  );
}

export default MultiSpaceExplore;
